import React from "react"
import { useSelector } from "react-redux"
import Blog from "./Blog"

const BlogList = () => {
  const blogs = useSelector((state) => state.blogs)

  return (
    <div>
      <h2>All blogs</h2>
      {blogs
        .sort((a, b) => b.likes - a.likes)
        .map((blog) => (
          <div key={blog.id}>
            <Blog blog={blog} />
          </div>
        ))}
    </div>
  )
}

export default BlogList
